import React from 'react';
import AddIcon from '@material-ui/icons/Add';
import { Button , Form , Row , Col} from 'react-bootstrap';

const NoteTitle = () => {
  return (
   <>
  
       <Row className="justify-content-center">
           <Col xs="4">
           <div className="note-title text-center shadow m-4 p-3">
           <Form className="form-group">
        <div class="form-group">
            <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="Title" />
       </div>
            <textarea   class="form-control m-auto" id="exampleFormControlTextarea1" rows="3" placeholder="write a note..." ></textarea>
            <Button className="btn btn-dark float-right"> <AddIcon/> </Button>
        </Form>
        </div>
      </Col>
       </Row>
      
      
   </>
  )
 
}
export default NoteTitle;
